!function(){Template.__checkName("about"),Template.about=new Template("Template.about",function(){var e=this;return HTML.Raw('<div class="">\n        <div class="row">\n            <div class="col-lg-12">\n                <div class="hpanel blog-article-box">\n                    <div class="panel-heading">\n                        <h1>The Market for Instagram Influencers</h1>\n                        <small>I collected some data at work and calculated how much your account is worth, per post, on Instagram.</small>\n                        <div class="text-muted small">\n                            Written by: <a href="https://ca.linkedin.com/in/davidhurley1"><span class="font-bold">David Hurley</span></a>\n                        </div>\n                    </div>\n                    <div class="panel-body">\n                        <p>\n                           I work for a startup called <a href="http://www.hashtagpaid.com">#paid</a> and we are building a marketplace for Instagram influencers. Believe it or not, if your famous on Instagram, there are businesses willing to pay you to post about them. Im sure youve already seen these types of ads in your feed but if you havent heres an example,\n                        </p>\n                        <br>\n                        <blockquote>\n                            <p><a href="https://instagram.com/p/4zxwt8t5yK/">Tilt ad created by @torriwebster.</a></p>\n                        </blockquote>\n                        <br>\n                        <p>\n                            <a href="https://www.tilt.com/">Tilt</a> paid @torriwebster to post this in an stragtegic attempt to gain followers. Take a look at Tilt\'s <a href="https://instagram.com/explore/tags/gettilted/">#getTILTED</a> hashtag. They used this to create a following in order to boost their own account. If you look through that hashtag you won\'t see another post with over 1,000 likes. @torriwebster was able to get over 12,000 likes or in other words, she was able to introduce #getTILTED to over 12,000 new people.\n                        </p>\n                        <br>\n\n                        <p>\n                            I won\'t tell you how much @torriwebster was paid to do this but our team facilitated the deal. We made the introduction, put her and Tilt in a chat room, and they figured out the rest. Tilt pays us and we in turn, pay our influencer. The only hard part in this process is determining how much an influencer should charge in the first place. \n                        </p>\n                        <br>\n                        <p>\n                            When influencers sign up to our platform most don\'t really know how much they are worth. For the last year we\'ve been manually helping them determine this. By \'manually\' I mean we have two members on our team, <a href="https://instagram.com/yourgirlmax/">@yourgirlmax</a> and <a href="https://instagram.com/lifewithpedro/">@lifewithpedro</a>, help them figure it out. They told me their value depends on their followers and engagement. Let me be clear,\n                        </p>\n                        <br>\n                        <blockquote>\n                            <p>There\'s a relationship between value, followers, likes and comments.</p>\n                        </blockquote>\n                        <br>\n\n                        <p>\n                            Followers, likes and comments are all public information so that\'s easy to get. It\'s harder to get value per paid post but #paid has been collecting that data for awhile now, data which I was able to collect from our database. I put all the data into Excel doc and started trying to pin down some sort of relationship.\n                        </p>\n                        <br>\n                        <p>\n                            Without getting too technical there does exist a positive logarithmic relationship between comments, likes, followers and how much an influencer charges on our platform. If you want to get some specifics on the statistical analysis feel free to shoot me an email at dhurley@hashtagpaid.com. Now that I had a formula to work with I decided it would make sense to test it with the app your using right now.\n                        </p>\n                        <br>\n                        <p>\n                            I don\'t know all the relevant variables yet but that\'s what makes this fun, the path to discovery. I\'m in the process of collecting more data on both sides of the market to optimize the current algorithm. I may never figure out how much your worth on Instagram but there are two things I do know - if you like a business, dont be afraid to promote it on Instagram and if you represent a business, start figuring out a cool way to leverage this kind of value. \n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>')}),Template.__checkName("updateAllUsers"),Template.updateAllUsers=new Template("Template.updateAllUsers",function(){var e=this;return HTML.Raw('<button>Update now</button>\n    <a href="">Add Growth</a>')})}();

